import React,{Component} from "react";

class MyApp extends Component{
      constructor()
      {
            super()
            this.state={
                  name:"Kishan",
                  age:19
            }
      }
      render()
      {
            return
            (
                  <div>
                        <h1>{this.state.name}</h1>
                  </div>
            )
            
      }
}
export default MyApp
